import {
  Box,
  Grid,
  Input,
  InputAdornment,
  InputLabel,
  Typography,
  IconButton,
} from "@material-ui/core";
import React, { useState } from "react";
import VisibilityIcon from "@material-ui/icons/Visibility";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";

export default function ChangePassword() {
  return (
    <Box className="container ">
      <Grid container justifyContent="center" spacing={1}>
        <Grid item xs={12} className="my-5 text-center">
          <Typography variant="h4" className="font-family-Ad" color="white ">
            Change My Password
          </Typography>
        </Grid>
        {listInput.map((item, index) => {
          return <InputChange item={item} key={index} />;
        })}
      </Grid>
    </Box>
  );
}

const InputChange = (props) => {
  const [show, setShow] = useState(false);

  return (
    <Grid item xs={8}>
      <InputLabel sx={{ color: "#999" }}>{props.item.label}</InputLabel>
      <Input
        type="text"
        className="form-control member-input"
        endAdornment={
          <InputAdornment position="end">
            <IconButton></IconButton>
          </InputAdornment>
        }
      />
    </Grid>
  );
};

const listInput = [
  {
    label: "Old Password",
  },
  {
    label: "New Password",
  },
  {
    label: "Re-New Password",
  },
];
